/**
 * Admin Dashboard Page
 * 
 * Displays admin overview and moderation tools:
 * - Summary cards showing total users, agents, properties, and bookings
 * - Table of newest users with deactivation controls
 * - Table of newest properties with deactivation controls
 * - Handles loading and error states
 */

import React, { useState, useEffect } from 'react';
import { format } from 'date-fns';

interface Overview {
  users: number;
  agents: number;
  properties: number;
  bookings: number;
}

interface User {
  id: number;
  name: string;
  email: string;
  createdAt: string;
  isActive: boolean;
}

interface Property {
  id: number;
  title: string;
  price: number;
  createdAt: string;
  isActive: boolean;
  owner: {
    name: string;
  };
}

const AdminDashboardPage: React.FC = () => {
  const [overview, setOverview] = useState<Overview | null>(null);
  const [users, setUsers] = useState<User[]>([]);
  const [properties, setProperties] = useState<Property[]>([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        setLoading(true);
        const [overviewRes, usersRes, propertiesRes] = await Promise.all([
          fetch('http://localhost:4000/api/admin/overview', {
            headers: {
              'Authorization': `Bearer ${localStorage.getItem('token')}`,
            },
          }),
          fetch('http://localhost:4000/api/admin/users?limit=5', {
            headers: {
              'Authorization': `Bearer ${localStorage.getItem('token')}`,
            },
          }),
          fetch('http://localhost:4000/api/admin/properties?limit=5', {
            headers: {
              'Authorization': `Bearer ${localStorage.getItem('token')}`,
            },
          }),
        ]);

        if (!overviewRes.ok || !usersRes.ok || !propertiesRes.ok) {
          throw new Error('Failed to fetch data');
        }

        const [overviewData, usersData, propertiesData] = await Promise.all([
          overviewRes.json(),
          usersRes.json(),
          propertiesRes.json(),
        ]);

        setOverview(overviewData);
        setUsers(usersData.users);
        setProperties(propertiesData.properties);
      } catch (err) {
        setError(err instanceof Error ? err.message : 'An error occurred');
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  const handleDeactivateUser = async (userId: number) => {
    try {
      const response = await fetch(`http://localhost:4000/api/admin/users/${userId}/deactivate`, {
        method: 'PUT',
        headers: {
          'Authorization': `Bearer ${localStorage.getItem('token')}`,
          'Content-Type': 'application/json',
        },
      });

      if (!response.ok) {
        throw new Error('Failed to deactivate user');
      }

      setUsers(users.map(user => 
        user.id === userId 
          ? { ...user, isActive: false }
          : user
      ));
    } catch (err) {
      setError(err instanceof Error ? err.message : 'Failed to deactivate user');
    }
  };

  const handleDeactivateProperty = async (propertyId: number) => {
    try {
      const response = await fetch(`http://localhost:4000/api/admin/properties/${propertyId}/deactivate`, {
        method: 'PUT',
        headers: {
          'Authorization': `Bearer ${localStorage.getItem('token')}`,
          'Content-Type': 'application/json',
        },
      });

      if (!response.ok) {
        throw new Error('Failed to deactivate property');
      }

      setProperties(properties.map(property => 
        property.id === propertyId 
          ? { ...property, isActive: false }
          : property
      ));
    } catch (err) {
      setError(err instanceof Error ? err.message : 'Failed to deactivate property');
    }
  };

  if (loading) {
    return (
      <div className="flex justify-center items-center min-h-screen">
        <div className="animate-spin rounded-full h-12 w-12 border-t-2 border-b-2 border-blue-500"></div>
      </div>
    );
  }

  return (
    <div className="container mx-auto px-4 py-8">
      <h1 className="text-3xl font-bold text-gray-800 mb-8">Admin Dashboard</h1>

      {error && (
        <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded mb-4">
          {error}
        </div>
      )}

      {/* Summary Cards */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6 mb-8">
        <div className="bg-white rounded-lg shadow p-6">
          <h2 className="text-xl font-semibold text-gray-700 mb-2">Total Users</h2>
          <p className="text-3xl font-bold text-blue-600">{overview?.users || 0}</p>
        </div>
        <div className="bg-white rounded-lg shadow p-6">
          <h2 className="text-xl font-semibold text-gray-700 mb-2">Total Agents</h2>
          <p className="text-3xl font-bold text-green-600">{overview?.agents || 0}</p>
        </div>
        <div className="bg-white rounded-lg shadow p-6">
          <h2 className="text-xl font-semibold text-gray-700 mb-2">Total Properties</h2>
